import React, { Component } from "react";

class Page extends Component {
  state = {};
  render() {
    const { pageText, pageClick, pageNumber } = this.props;
    return (
      <li className="page-item">
        <a className="page-link" href={() => pageClick(pageNumber)}>
          {pageText}
        </a>
      </li>
    );
  }
}

export default Page;
